export const TVSHOW = [
    {
        id: 2,
        title: 'TV Show Selector',
        img: 'assets/TV.png',
        des: 'I was asked to write tests for this web application to ensure that the feature I was working on displays all requested data properly. The feature was to fetch data from the API and display it to the page. I evaluated where state was being managed, where the async call was, and where different pieces of data were being rendered. Then wrote tests for both the App.js component and the Episodes.js component. All tests successfully passed!'
    }
]

export const Plants = [
    {
        id: 3,
        title: 'React Plants Ecommerce',
        img: 'assets/plants.png',
        des: 'During this project I was able to add class components, a custom hook, and tests to a basic ecommerce site that would allow me to request product from a server and render that data. I was also able to implement the ability to add items to a shopping cart successfully.'
    }
]

export const Bubble = [
    {
        id: 4,
        title: 'Bubble Color Picker',
        img: 'assets/ColorPicker.png', 
        des: 'In this project I built a basic CRUD application. I created a login page that requested a token from a server that would allow users to send all other requests to the server. I was able to then fetch data from a color array, update data, and delete the data.'
    }
]
